function processQuickpay(){var b=new Spinner().spin(document.getElementById("qp-merchant-form"));jQuery(".qp-server-response").html('<div class="isa_info"><i class="fa fa-spinner fa-spin"></i> Processing...</div>');var a=jQuery("#qp-merchant-form").serializeArray();jQuery.ajax({type:"POST",url:qp_ajax.ajax_url,data:a,error:function(c){var d="";if(c.status===500){d=(c.responseJSON.message)?c.responseJSON.message:"Sorry an internal server error occured"}else{if(c.status===403){d="Sorry operation denied"}else{if(c.status===400){d=(c.responseJSON.message)?c.responseJSON.message:"Bad request"}else{if(c.status===0){d="Sorry server cannot be reached. Please check your internet connection"}else{d="Sorry unknown error occured (Response code: "+c.status+")"}}}}console.log("Error: "+JSON.stringify(c));jQuery(".qp-server-response").html('<div class="isa_error"><i class="fa fa-times-circle"></i>'+d+"</div>");b.stop()},success:function(c){if(c){if(c.message){jQuery(".qp-server-response").html('<div class="isa_success"><i class="fa fa-check"></i>'+c.message+"</div>")}b.stop()}}})};